import React from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  // Fetch user's goals, progress, and deadlines

  return (
    <div className="dashboard">
      <h1>Dashboard</h1>
      
      {/* Display user's goals */}
      <h2>Goals</h2>
      <GoalsComponent />
      
      {/* Display user's progress */}
      <h2>Progress</h2>
      <ProgressComponent />
      
      {/* Display upcoming deadlines */}
      <h2>Deadlines</h2>
      <DeadlinesComponent />
      
      <Link to="/create-goal">Create New Goal</Link>
    </div>
  );
}

export default Dashboard;
